// src/components/Navbar/NavbarCasual.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css';


const NavbarCasual = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/casual/ResumeAndCertificates">Resume and Certificates</Link></li>
        <li><Link to="/casual/portfolio">Portfolio</Link></li>
        <li><Link to="/casual/about-me">About Me</Link></li>
        <li><Link to="/casual/contact">Contact</Link></li>
      </ul>
    </nav>
  );
};

export default NavbarCasual;
